import React from 'react';
import Quotes from './Quotes';

const container = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",
  background: "red",
  width: 400,
  height: 300
}

function App() {
  return (
    <div className="app-container" id="quote-box" style={container}>
      <Quotes />    
      <Buttons />
    </div>
  );
}

export default App;
